    char const* _depthToDtype(int depth)
    {
        switch(depth)
        {
        case CV_8U:
            return "u1";
        case CV_8S:
            return "i1";
        case CV_16U:
            return "u2";
        case CV_16S:
            return "i2";
        case CV_32S:
            return "i4";
        case CV_32F:
            return "f4";
        case CV_64F:
            return "f8";
        }

        return NULL;
    }

    int _toCvType(std::string const& dtype, int nChannel)
    {
        int depth;
        if (dtype == "u1")
        {
            depth = CV_8U;
        }
        else if (dtype == "i1")
        {
            depth = CV_8S;
        }
        else if (dtype == "u2")
        {
            depth = CV_16U;
        }
        else if (dtype == "i2")
        {
            depth = CV_16S;
        }
        else if (dtype == "i4")
        {
            depth = CV_32S;
        }
        else if (dtype == "f4")
        {
            depth = CV_32F;
        }
        else if (dtype == "f8")
        {
            depth = CV_64F;
        }

        return CV_MAKETYPE(depth, nChannel);
    }


